import React from "react";

function Road(props) {

   if(props.isHorizontal != false){
        return (
            <div
            style = {{position:'relative',
            height: '10em', 
            width: '15em', 
            backgroundColor: 'gray',
            top: '2em'}}>
            </div>
        )
        } else {
            return(
            <div
            style = {{position:'relative',
            height: '10em', width: '15em', 
            backgroundColor: 'gray',top: '12em', right: '15em'}}>
            </div>
            )
        }
}

export default Road;
